  false,\n\t\"url\": null,\n\t\"notes\": \"Middleton Island harbors the largest colony
  of Pelagic Cormorants and Black-legged Kittiwakes in the Gulf of Alaska. Goals of
  the study were to assess the current population level and breeding status of Pelagic
  Cormorants, Glaucous-winged Gulls, Black-legged Kittiwakes, Common Murres, and Thick-billed
  Murres, and to compare these with the results of previously conducted studies. Secondly,
  we wanted to begin a program of monitoring the reproductive efforts of Black-legged
  Kittiwakes and Pelagic Cormorants.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
